import './App.css';

function App() {
	return (
		<div>
			<div className="outer-rectangle center">
				<div className="top-rectangle top-center"></div>
				<div className="inner-rectangle inner-center"></div>
				{/* <div className="socials-center">
					<div className="socials">LinkedIn</div>
					<div className="socials">Github</div>
					<div className="socials">Mail</div>
				</div> */}
				<div className="socials socials-center">LinkedIn</div>
				<div className="socials ">Github</div>
				<div className="socials ">Mail</div>
			</div>
			<div className="circle circle-center"></div>
			<div className="inner-circle circle-center"></div>
		</div>
	);
}

export default App;
